const _hoisted_6 = /* @__PURE__ */ createStaticVNode('<h2 id="info" tabindex="-1"><a class="header-anchor" href="#info" aria-hidden="true">#</a> Info</h2><p><strong>Bio-Data</strong></p><ul><li>Class: Alter Ego</li><li>True Name: Heaven&#39;s Hole/Third Heterodoxy Pleasure Deva of Deliberate Delight</li><li>Gender: Female</li><li>Source: Fate/EXTRA CCC</li><li>Region: Moon Cell SE.RA.PH</li><li>Alignment: Chaotic Evil</li><li>Height: 166cm~half a yojana[1]</li><li>Weight: 53~??kg</li></ul><p><strong>Meta</strong></p><ul><li>Character Creator: Nasu Kinoko</li><li>Character Illustrator: Wada Arco</li><li>Character Voice: Tanaka Rie</li><li>Appearance in Main Works: Fate/EXTRA CCC</li></ul><h2 id="stats" tabindex="-1"><a class="header-anchor" href="#stats" aria-hidden="true">#</a> Stats</h2><table><thead><tr><th style="text-align:left;">Parameters</th><th style="text-align:center;">Values</th></tr></thead><tbody><tr><td style="text-align:left;">Strength</td><td style="text-align:center;">D</td></tr><tr><td style="text-align:left;">Constitution</td><td style="text-align:center;">A+</td></tr><tr><td style="text-align:left;">Agility</td><td style="text-align:center;">B+</td></tr><tr><td style="text-align:left;">Magical Power</td><td style="text-align:center;">EX</td></tr><tr><td style="text-align:left;">Luck</td><td style="text-align:center;">E</td></tr><tr><td style="text-align:left;">Noble Phantasm</td><td style="text-align:center;">EX</td></tr></tbody></table><h2 id="class-skills" tabindex="-1"><a class="header-anchor" href="#class-skills" aria-hidden="true">#</a> Class Skills</h2><p><strong>Authority of the Beast D</strong></p><p>A skill that can surely be called Anti-Humanity.</p><p>Due to changing from a Beast into an Alter Ego, the rank has dropped significantly.</p><p>Benefits similar to those of a regular B-rank Independent Action are obtained.</p><p><strong>Independent Manifestation E</strong></p><p>Self-sealed due to changing into the Alter Ego class. &quot;Self-restraint&quot; is how one could put it.</p><p>Nonetheless, she possesses the &quot;instant death resistance&quot; and &quot;charm resistance&quot; that comes with Independent Manifestation.</p><p>In particular, she is 300% resistant to the charm debuff.</p><p><strong>Logos Eater C</strong></p><p>The special trait of the Pleasure Deva. Provides a damage buff against any sentient being that possesses intelligence (pleasure), regardless of scale or structure.</p><p>However, due to her current state as an Alter Ego, this skill also had its rank lowered. Currently, even that special trait is only comparable to touching. It&#39;s no different from foreplay.</p><p>Since Beast III is the love for humanity, naturally, it loves humans.</p><p>However, for Kiara, she, alone, is human. To Kiara, other people are nothing but toys used to satisfy herself, the human.</p><p><strong>Nega Saver A</strong></p><p>The fate of the beast who tried to bring salvation only to her own world, while possessing the qualifications to be a messiah (Saver).</p><p>Every skill possessed by the Saver and Ruler class is nullified, targets with magic stat not exceeding A rank are charmed with a 300% probability and the effect of buffs cast by Kiara are increased by 200%.</p><p>Although the scale of the existence of the Pleasure Deva that was born once on the moon is superior to Beast III, they say that she had no choice but to withdraw when faced with a messiah since she did not possess this skill.</p><h2 id="personal-skills" tabindex="-1"><a class="header-anchor" href="#personal-skills" aria-hidden="true">#</a> Personal Skills</h2><p><strong>Clairvoyance (Beast) D</strong></p><p>The rank of her Clairvoyance is low so she cannot see far without obstruction.</p><p>Nevertheless, she can see through and reveal the desires and true nature of the humans before her eyes.</p><p>...That in itself would be the skill of a sage, but by revealing the animalistic and true nature of the other party, Kiara is aroused, gaining overwhelming joy from the procedure. Just like a poisonous snake licking her lips in front of her prey.</p><p>In FGO, it drastically reduces a single target&#39;s debuff resistance and charges one&#39;s own NP gauge. Moreover, it&#39;s even capable of reducing their Arts resistance.</p><p><strong>Thesis of the Still Heart (Five Thought-Stopping Meditations) A</strong></p><p>Gojoshinkan.[2] Health-care software developed by Sesshouin Kiara.</p><p>With the cyber magic formula (Codecast) developed with the purpose of taking care of one&#39;s mental health, it measures the stagnation and disturbances of the spirit and then physically removes them to stabilize it.</p><p>Originally created in order to produce a map of the patient\u2019s spirit to help understand it.</p><p>By nature, the tumor of the consciousness&#39; depths (SG) is something meant to be slowly brought to the surface, but with the Thesis of the Still Heart it is possible to detect it and swiftly pluck it out.</p><p>Although the SG is a secret, it is also a matter to be disclosed.</p><p>Anybody would want to guard their secrets, but, at the same time, they would also want someone know about them.</p><p>A heart that persists in guarding its secrets is &quot;pitiful&quot;.</p><p>Humans are creatures who want comfort. Because it&#39;s a secret they don&#39;t want anyone to know about, they have to confide in someone, be understood and ask for forgiveness. The Thesis of the Still Heart was created with the goal of granting the desire held in the depths of the heart, the true mutual understanding of the people...is what Kiara claims.</p><p>In FGO, it reduces the NP gauge of every enemy and their defenses.</p><p><strong>Goddess Metamorphosis EX</strong></p><p>A skill where one undergoes metamorphosis into a god.</p><p>A treasure trove of powerful buffs. Similar to Tamamo (Swimsuit)&#39;s Goddess Metamorphosis.</p><p>However, this has no stun the following turn; it reduces her HP instead.</p><p><strong>The Ceremony of the Human Order&#39;s Ascension to Heaven A</strong></p><p>By absorbing Zepar and raising Demon God Pillars inside her body, Kiara turned into a person with supernatural powers that can control Demon God Pillars.</p><p>The ones Kiara controls are not the &quot;72 Demon God Pillars&quot;, but &quot;Demon God Pillars who possess no name or personality&quot;. However, these numbers that one could call infinite, Kiara can control at will.</p><p><strong>Masochistic Constitution</strong></p><p>Passionlip&#39;s id_es. Converts 60% of physical and spiritual damage to one&#39;s own HP. This becomes an additional value.</p><p>(Not used in FGO)</p><p><strong>Sadistic Constitution</strong></p><p>Meltryllis&#39;s id_es. Snatches away the opponent&#39;s buffs, making it one&#39;s own.</p><p>(Not used in FGO)</p><p><strong>Bondage Preference</strong></p><p>Violet&#39;s id_es. The freezing of space. An enemy not possessing a Magic Resistance exceeding C rank, becomes stunned just from being in the surrounding space.</p><p>(Not used in FGO)</p><p><strong>Desire for Growth</strong></p><p>Kingprotea&#39;s id_es. Infinite growth (no level cap).</p><p>(Not used in FGO)</p><p><strong>Congeneric Disgust</strong></p><p>Kazuradrop&#39;s id_es. Predating on one&#39;s own species.</p><p>(Not used in FGO)</p><h2 id="noble-phantasm-s" tabindex="-1"><a class="header-anchor" href="#noble-phantasm-s" aria-hidden="true">#</a> Noble Phantasm(s)</h2><h1 id="pleasure-deva\u30FBthe-womb-realm-magdala" tabindex="-1"><a class="header-anchor" href="#pleasure-deva\u30FBthe-womb-realm-magdala" aria-hidden="true">#</a> Pleasure Deva\u30FBThe Womb Realm Magdala</h1><ul><li>Rank: EX</li><li>Classification: Anti-Unit Noble Phantasm</li><li>Range: 1~90</li><li>Maximum number of targets: 7 knights</li></ul><p>Amida Amidula\u30FBHeaven&#39;s Hole.</p><p>Anti-Human Order, or maybe Anti-Grand Noble Phantasm.</p><p>The Noble Phantasm for Beast III&#39;s exclusive-use, which breeds a virtually infinite amount of demon pillars within her own body.</p><p>The inside of her body has already become a single universe, the Sukhavati.[3]</p><p>Those brought inside her will disappear from reality, having their egos removed and their reason melted away.</p><p>No matter what kind of robust body or defensive armor one might have, they are meaningless inside Kiara\u2019s body; they are all rendered powerless like a newborn existence and liberated from earthly desires and the woes of man.</p><p>Beast III is the \u201Chole\u201D itself that was formed in reality, and those who fall into this hole taste the greatest pleasure imaginable right before disappearing and are absorbed by Kiara while drowning in ecstasy.</p><p>Depending on how you look at it, this end of being released from the world of suffering called reality could be called salvation.</p><p>In FGO, it deals damage that ignores defense and pierces invincibility. It also recovers one&#39;s HP by the means of ecstasy.</p><p>In addition, as a hidden trait, it deals bonus damage to the Grand-class.</p><h1 id="character" tabindex="-1"><a class="header-anchor" href="#character" aria-hidden="true">#</a> Character</h1><h2 id="pronouns" tabindex="-1"><a class="header-anchor" href="#pronouns" aria-hidden="true">#</a> Pronouns</h2><ul><li>First person pronoun: watakushi</li><li>Second person pronoun: \u25CB\u25CB\u25CB-san (attaching a &quot;-san&quot; to the name)</li><li>Third person pronoun: that lady, that gentleman (basically, it&#39;s a respectful way to say he or she)/mina-sama (a respectful way to say everyone)</li></ul><p>Refers to the Master as &quot;Master&quot; and &quot;Buyer-sama&quot;</p><h2 id="personality" tabindex="-1"><a class="header-anchor" href="#personality" aria-hidden="true">#</a> Personality</h2><p>Introverted, timid and active.</p><p>She is a graceful and elegant woman, but that does not mean she is straight-laced.</p><p>Possessing the tolerance and sophistication to respond to any joke with a smile, she is the &quot;my, oh my&quot; (TN.: ara ara maa maa) type.</p><p>Despite displaying a gentle nature and a chaste sense of values in her speech and expressions, every word of hers has a strange eroticism to it.</p><p>Gentle yet assertive. Lively despite looking sickly. Tenderly compassionate when it comes to empathy.</p><p>She possesses the discretion to perceive the truth of things, read the hearts of every person and properly understand their viewpoint and suffering.</p><p>A talented woman full of graceful beauty, both outside and inside. ...However, one could call her absent-minded to some extent, having the side of a young woman with a lot of superficial knowledge about sex. Instead of a &quot;holy woman&quot;, she ends up coming off a &quot;kind onee-san&quot;.</p><p>...such is how she appears on the surface.</p><p>Her true nature is that of a bewitching bodhisattva who did nothing but thoroughly explore narcissism and pleasure until she reached nirvana.</p><p>A tender sadist and a hard masochist.</p><p>Although she claims to love humans from the bottom of her heart, she is a monster of narcissism who speaks about morals and the value of life solely &quot;for her own sake&quot;, and even protects the world purely &quot;for her own sake&quot;.</p><p>No wonder then that for Kiara, only she is considered &quot;human&quot;, and the rest are nothing but beasts and insects wearing the guise of a person.</p><p>As such, despite directing her love towards everything in the outside world, its final destination ends up as something that is \u201Cfor her own sake\u201D.</p><p>A pervert not only when it comes to sexual pleasure, but also how she consumes the surrounding lives \u201Cfor her own sake\u201D and causes them to self-destruct in order to experience the greatest carnality.</p><p>If it&#39;s for that sake, it&#39;s alright to be violated or killed.</p><p>Being the one who does the violating and killing is also okay.</p><p>In any case, it is fine as long as that human&#39;s life comes to an end due to the body of the woman known as &quot;Sesshouin Kiara&quot;.</p><p>Kiara will attentively watch that form, simply smiling as she experiences ecstasy.</p><p>By watching over the life of humans in such a way, she is like a boddhisatva treating others with tender loving care.</p><p>Even if it is a path leading to destruction, for those who are being toyed with by her on the palm of her hand, this process is no different from heavenly pleasure.</p><p>\u25C7</p><p>It is said that to Kiara, who feels rapture from both pleasure and suffering, the greatest pleasure is the greatest pain.</p><p>The cybercity submerged in the deep sea\u2500\u2500\u2500\u2500\u2500\u2500While possessing the senses of men, the pain, sensations and disgust that comes from transforming into SE.RA.PH, is not something a human being could withstand. The more outstanding the intelligent lifeform is, the greater damage it receives from this contradiction, malaise, and loss of meaning.</p><p>On top of that, she was attacked by Servants too, so Kiara&#39;s agony, who became SE.RA.PH, would reach extremely high numerical values.</p><p>&quot;This is ecstasy too. After I&#39;ve endured this, the Pure Land will appear.&quot; The mentality that can accept and find pleasure in such pain is the greatest advantage of Sesshouin Kiara&#39;s vainglory and what makes her the worst threat to humanity.</p><h2 id="attitude-towards-master" tabindex="-1"><a class="header-anchor" href="#attitude-towards-master" aria-hidden="true">#</a> Attitude Towards Master</h2><p>By changing into an Alter Ego, she became a bit meeker.</p><p>Specifically speaking, she swore to herself to lead a life of abstinence until her contract ends.</p><p>Due to this, despite her personality remaining unchanged, the thought of preying on all who attract her attention is gone.</p><p>Her attitude towards the Master is like that of Buddha&#39;s enemy, Mara.</p><p>In spite of looking forward to the time the Master succumbs to their desires and indulges in them, she supports them so they won&#39;t give in to the temptation.</p><p>When the Master gives in to Kiara&#39;s allure, it seems like she will transform from an Alter Ego into a Beast.</p><p>Kiara&#39;s lines during her final ascension clearly express this.</p><p>This is what she says as she views the universe, stemming from the overwhelming joy she felt from becoming a Tenma.</p><p>\u300CAah, what a thing... To think that offering up my body with this heart and all of its desires would cause me to take on this form....\u300D</p><p>(Of course, she takes pleasure even from feeling ashamed)</p><p>\u300CI am now the center of the universe, nobody can escape from these fingers of mine, no matter who they are.</p><p>...However, ufufu, not yet, I&#39;m still not satisfied at all.</p><p>My vow will remain everlasting until my love fills this whole universe.\u300D</p><p>(From here on out are the lines she utters as she turns her eyes to the Earth. She changes her object of focus to the Master on top of her palm.)</p><p>\u300CBut please, be at ease, Master.</p><p>I am your Servant and you are my beloved contractor.</p><p>Regardless of the time or place, this relationship of ours will never change.</p><p>But...Ufufu.</p><p>Fuu~ (She releases a long breath towards the top of her palm) Please, do be careful, alright? After all, I am a fickle woman...</p><p>I do not know what I&#39;d do if you were to fall from the palm of my hands.\u300D</p><p>Although, in such a manner, Kiara has transformed into a semi-boddhisatva, as long as she is an Alter Ego, she&#39;ll never become a threat to humanity.</p><h2 id="dialogue-examples" tabindex="-1"><a class="header-anchor" href="#dialogue-examples" aria-hidden="true">#</a> Dialogue Examples</h2><ul><li>&quot;Alter Ego, Sesshouin Kiara. I have come after hearing your voice, wishing for salvation.</li></ul><p>Even so, fufu... To think you would call for a woman like me, just what kind of person are you, I wonder. I am the Demonic Boddhisatva who relishes in the taste of all living things, making no distinction between sentient and nonsentient beings. There is no longer any other choice left but to descend to the pits of Hell together, no?&quot;</p><ul><li>&quot;If I&#39;m forced to say it, it&#39;s for the sake of love[4], I think.</li></ul><p>For the sake of my love, the people known as humans, I want to dissolve them all.&quot;</p><ul><li><p>&quot;Have you become aware of it? Both you and BB, no, every creature trapped on this Far Side of the Moon, are simply frolicking on the palm of my hand.&quot;</p></li><li><p>&quot;Fufu\u2500\u2500\u2500\u2500Fufufu. Yes. I am a poisonous insect.</p></li></ul><p>If I do not collect every flower and their nectar, I won&#39;t be able to flap my wings.</p><p>After all, this is the way of God.</p><p>The worldly desires that are hard to come by pouring into this body of mine will elevate me to a greater height and I will metamorphose into a god.</p><p>All living creatures possess the nature of Buddha,[5] plants and countries can all enter Nirvana[6] \u2500\u2500\u2500\u2500\u2500\u2500</p><p>The lives of all living beings, regardless of their sentience, will be used for my sake.&quot;</p><ul><li>&quot;While thinking, I piled up good deeds.</li></ul><p>As long as good and evil are hard to measure and there is equality in this world, something like equal happiness won&#39;t exist.[7]</p><p>Therefore, let this universe be filled with my love alone.</p><p>With my sacrifice alone, I will rescue all from wisdom.</p><p>Well then, everyone, the day of salvation has come.</p><p>\u2500\u2500\u2500\u2500\u2500\u2500Liberate the Heavens from earthly desires and the woes of man.</p><h2 id="character-in-fgo" tabindex="-1"><a class="header-anchor" href="#character-in-fgo" aria-hidden="true">#</a> Character in FGO</h2><p>The true boss of \u300EFate/EXTRA CCC\u300F.</p><p>Taking over the Moon Cell used by BB, she metamorphosed into a divine Daemon. The Mara sprouting from her head are that of a Tenma. In other words, it signifies the fact that this person is the enemy of Buddha.</p><p>The embodiment of narcissism prioritizing pleasure above all.</p><p>That process where other people are made use of and preyed upon is a calamity that brings ruin to men and animals alike.</p><p>The people who knew this woman, at first, were mesmerized when they into contact with her Holy Mother-like affection, and enthralled. After that, they exposed their foolishness in the single-minded pursuit of the desire to be loved by her; however, if it was satisfied so easily, the desire would end up weakening.</p><p>Weak desires are unwanted by this woman.</p><p>Unable to hold her interest, the believers took their lives as they despaired that &quot;they weren&#39;t loved by her anymore&quot;. The victims&#39; bodies and assets would then become her food in their entirety.</p><p>This woman is an evil specter who perceives all of her deeds as something good and advocates them as so.</p><p>This specter does not tell a single lie about herself, however, she preys on her surroundings with words full of falsehoods and consumes them for her own sake.</p><p>When seen from a normal person&#39;s point of view, the absoluteness of that ego and that lack of hesitation is a state of enlightenment. If there was one thing that could be called &quot;saint-like&quot; about her, it&#39;s this.</p><p>\u25C7</p><p>In \u300EFateGO\u300F, she is introduced as a staff member of the maritime oil field base, Seraphix.</p><p>While she was exasperated upon being allocated to the Western church despite being a Buddhist, she wholeheartedly endeavored in her professional duties.</p><p>At this point of time Kiara was unmistakably a saint, but on January 2017, having escaped successfully from the Temple of Time, the Demon God Pillar Zepar hijacked her body, turning her into a puppet in order to control Seraphix as the pawn of the Demon God.</p><p>...at least that&#39;s how it was supposed to go, but, at some point, Zepar itself was the who ended being controlled by Kiara, who turned into a majin that could freely manipulate demon pillars and, in the end, she was reborn as a Beast.</p><p>Kiara discovered her most excellent self among the multitudes of parallel worlds and fused with her. Bringing over the imaginary number phenomenon of the CCC world to the FGO world, she turned her own body into SE.RA.PH and grew by using Servants as a source of nutrients.</p><p>Ultimately, she was planning to become one with the planet, but by the hands of BB, Meltryllis, Passionlip and the Master of Chaldea, her climax was prevented.</p><h2 id="related-characters" tabindex="-1"><a class="header-anchor" href="#related-characters" aria-hidden="true">#</a> Related Characters</h2><p><strong>BB (Swimsuit)</strong></p><p>My... I have achieved eclosion by my own karma, but it appears she had such grounding since the beginning.</p><p>For her to get along with a God from Deep Space, she is truly a heretic among heretics at her core. As fellows with similar circumstances, let&#39;s get along, shall we?</p><p><strong>Meltryllis</strong></p><p>Her pleasure and the pleasure of a woman, that alone could be called the difference, but that Ego and I are opposite existences.</p><p>If there is a next time, yes, not just her hands, I&#39;ll smash her legs too and throw her away at a garbage dump.</p><p><strong>Tamamo no Mae</strong></p><p>To think a bunrei like that would be created by the principal object of my worship, I am astonished.</p><p>No, rather, I am deeply moved. It&#39;s the most optimal way to enjoy life.</p><p>Fufu. Fine things, aren&#39;t they? The Tamamo Nine. Should I also follow their example in secret?</p><p><strong>???</strong></p><p>I see, so that was L.</p><p>I&#39;m a being that receives love from all. They are a being that gives love to all.</p><p>This means we&#39;ll never be able to stand together, no?</p><p><strong>A certain Caster</strong></p><p>It&#39;s not like I&#39;m concerned or anything like that, but isn&#39;t that person in bad shape?</p><p>After all, there is no sharpness to his abusive language. That is just a nice person who&#39;s simply hard to understand!</p><p>He used to be way worse than this. Laughing at the private parts I was the most conscious about without holding anything back and driving me away without giving a damn, such a useless person...</p><p>Eh? It depends on the other party, you say? In other words, that is... Pardon me, I remembered an errand I have to take care of so I&#39;ll be excusing myself here, alright? (Kiara absconds while blushing furiously)</p><h2 id="comment-from-the-illustrator" tabindex="-1"><a class="header-anchor" href="#comment-from-the-illustrator" aria-hidden="true">#</a> Comment from the Illustrator</h2><p>Awright, Ms. Kiara~ let&#39;s make your final ascension amazing! And so -\u300Ca cross-section view of a woman pregnant with the Earth\u300D or \u300Ca naked portable shrine in space\u300D or \u300Can ordinary wide leg-spread\u300D- three amazingly rough concepts, where nothing is shown and nothing is worn, were assembled, but they were really, really, really, completely out of the question. I learned a lot from this. Ain&#39;t that right!!!! I drew her standing pose in the image of Buddhist pictures. Can I make the background a little more Mandala-like? Or would that be too much trouble?? (Wada Arco)</p><h1 id="translation-notes" tabindex="-1"><a class="header-anchor" href="#translation-notes" aria-hidden="true">#</a> Translation Notes:</h1><p>[1] A Yojana is a Vedic measure of distance used in ancient India. The exact measurement is disputed amongst scholars with distances being given between 6 to 15 kilometers (4 to 9 miles).</p><p>[2] So apparently, in nenbutsu, there is a method of contemplation where the mind is suspended to see things more correctly called &#39;gojoshinkan&#39; (\u4E94\u505C\u5FC3\u89B3).</p><p>[3] Sukhavat\u012B, or the Western Paradise, refers to the western pure land of Amida in Mahayana Buddhism.</p><p>[4] Something interesting to note here is that while &quot;\u611B&quot; usually means love or affection, it can mean craving and desire as a Buddhist term which suits Kiara perfectly.</p><p>[5] One of the ideologies of Mahayana Buddhism. They think that every sentient being has the potential to become Buddha.</p><p>[6] This is apparently from the Nirvana Sutra and it&#39;s pretty self-explanatory.</p><p>[7] Another line I was struggling with. Original is &quot;\u5584\u60AA\u306F\u8A08\u308A\u304C\u305F\u304F\u3001\u3053\u306E\u4E16\u304C\u5E73\u7B49\u3067\u3042\u308B\u304B\u304E\u308A\u3001\u5E73\u7B49\u306E\u5E78\u798F\u306A\u3069\u5B58\u5728\u3057\u306A\u3044&quot;</p><h2 id="material-images" tabindex="-1"><a class="header-anchor" href="#material-images" aria-hidden="true">#</a> Material Images</h2><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-162.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-163.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-164.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-165.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-166.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-167.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-168.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-169.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-170.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-171.jpg?raw=true" alt=""></p><h2 id="dialogue" tabindex="-1"><a class="header-anchor" href="#dialogue" aria-hidden="true">#</a> Dialogue</h2><table><thead><tr><th style="text-align:left;">Occassion</th><th style="text-align:center;">English</th><th style="text-align:center;">Japanese</th></tr></thead><tbody><tr><td style="text-align:left;">Summoned</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr></tbody></table>', 206);
